import {Route, Navigate} from 'react-router-dom'


const PrivateRoute = ({ children }) => {
    console.log('Private route!')

    const isAuthenticated = true

    if (!isAuthenticated) {
        return <Navigate to='/login' />
    }

    return children
}

export default PrivateRoute
